// mixins/_grid.scss
// from https://github.com/thingsym/flexbox-grid-mixins (very cool)
// =======================================

// define grid
@mixin grid(
  $display: flex,
  $flex-direction: null,
  $flex-wrap: null,
  $flex-flow: null,
  $justify-content: null,
  $align-items: null,
  $align-content: null,
  $gutter: null,
  $grid-type: skeleton
) {

  @if $display {
    display: $display;
  }

  @if $flex-direction {
    flex-direction: $flex-direction;
  }

  @if $flex-wrap {
    flex-wrap: $flex-wrap;
  }

  @if $flex-flow {
    flex-flow: $flex-flow;
  }

  @if $justify-content {
    justify-content: $justify-content;
  }

  @if $align-items {
    align-items: $align-items;
  }

  @if $align-content {
    align-content: $align-content;
  }

  @if $grid-type == skeleton {
    @if $gutter {
      @include grid-gutter($margin: 0 $gutter / 2 * -1);
    }
  }

  @content;
}

// define grid gutter
@mixin grid-gutter(
  $margin: null,
  $margin-top: null,
  $margin-right: null,
  $margin-bottom: null,
  $margin-left: null
){
  @if $margin != null {
    margin: $margin;
  }

  @if $margin-top != null {
    margin-top: $margin-top;
  }

  @if $margin-right != null {
    margin-right: $margin-right;
  }

  @if $margin-bottom != null {
    margin-bottom: $margin-bottom;
  }

  @if $margin-left != null {
    margin-left: $margin-left;
  }
}

// define grid col
