@mixin ellipsis(
  $line: 1
) {
  @if $line==1{
    overflow: hidden;
    text-overflow:ellipsis;
    white-space: nowrap;
  } @else {
    display: -webkit-box;
    -webkit-box-orient: vertical;
    -webkit-line-clamp: $line;
    overflow: hidden;
  }
}

@mixin ripple(
  $pseudo: ':before',
  $color: #000,
  $opacity: .2
) {
  position: relative;
  overflow: hidden;
  transform: translate3d(0, 0, 0);

  @if $pseudo!=':before' {
    $pseudo: ':after'
  }
  &#{$pseudo} {
    content: "";
    display: block;
    position: absolute;
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
    pointer-events: none;
    background-image: radial-gradient(circle, $color 10%, transparent 10.01%);
    background-repeat: no-repeat;
    background-position: 50%;
    transform: scale(10, 10);
    opacity: 0;
    transition: transform .5s, opacity 1s;
  }
  &:active#{$pseudo} {
    transform: scale(0, 0);
    opacity: .2;
    transition: 0s;
  }
}

@import "../var";

@mixin elevation(
    $z:0,
    $important: false,
    $transition: false,
    $duration: 280ms,
    $easing: cubic-bezier(.4, 0, .2, 1)
) {
    $z: $z + 1;
    $box-shadow: nth($__ElevationShadowKeyUmbra, $z), nth($__ElevationShadowKeyPenumbra, $z), nth($__ElevationShadowKeyAmbient, $z);

    @if $important {
        $box-shadow: $box-shadow !important;
    }
    box-shadow: $box-shadow;
    @if $transition {
        @include elevation-transition($duration: $duration, $easing: $easing);
    }
}

@mixin elevation-transition(
    $duration: 280ms,
    $easing: cubic-bezier(.4, 0, .2, 1)
) {
    transition: box-shadow $duration $easing;
    will-change: box-shadow;
}
